import React from "react";
import { Navbar, Nav } from "reactstrap";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import "./navbar.scss";
import { useSelector } from "react-redux";
import { useState } from "react";

const NavBar = props => {
  const [checklogin, setChecklogin] = useState({});
  useSelector(state => {
    console.log("state", state);
    setChecklogin({ isloggedin: state.Auth.isloggedin });
  });
  return (
    <div className="header_navigation">
      <Navbar className="navbarLinks" color="light" light expand="md">
        <h2 className="logo">
          <Link to="/">AdialaJee</Link>
        </h2>

        <Nav className="ml-auto" navbar>
          <ul className="navLinks">
            <NavLink className="home" to="/" name="Home" />

            <NavLink className="dashboard" to="/dashboard" name="Dashboard" />

            <>
              <li className="login">
                <i className="icon"></i>
                <Link to="/login">Login</Link>
              </li>
              <li className="register">
                <i className="icon"></i>
                <Link to="/register">Register</Link>
              </li>
            </>
          </ul>
        </Nav>
      </Navbar>
    </div>
  );
};

export default NavBar;

const NavLink = ({ className, to, name }) => {
  return (
    <li className={className}>
      <i className="icon"></i>
      <Link to={to}>{name}</Link>
    </li>
  );
};
